import { createIcon } from "../icon/createIcon";

export const DoubleChevronRightIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="DoubleChevronRightIcon">
    <path d="M6.605.498 11.502 6l-4.897 5.502-1.103-1.003 4.004-4.498-4.004-4.498L6.605.5zM1.548.5 7.003 6l-5.455 5.5-1.045-1.055L4.911 6 .503 1.555 1.548.5z" />
  </svg>,
  "DoubleChevronRight",
  "double chevron right"
);
